const varsRegex = /\${([^}]*)}/g;

const insertVariable = function(pattern, name, value){
    let result = pattern;
    let match = varsRegex.exec(pattern);
    while (match !== null) {
        const variable = match[0];
        const variableName = match[1];
        if (variableName === name) {
          result = result.replace(variable, value);
        }
        match = varsRegex.exec(pattern);
    }
    return result;
};

const buildDashboardTitle = function(stateController){
    let result = "";

    const {stateValue, states, stateObject} = stateController;
    const state = stateObject.find(function(state){return state.id === stateValue;});
    const stateName = states[stateValue].name;

    const {params} = state;
    const entityName = params && params.entityName ? params.entityName : ""; 
    const entityLabel = params && params.entityLabel ? params.entityLabel : "";

    result = insertVariable(stateName, "entityName", entityName);
    result = insertVariable(result, 'entityLabel', entityLabel);

    for (const prop of Object.keys(params)) {
        if (params[prop] && params[prop].entityName) {
            result = insertVariable(result, prop + ':entityName', params[prop].entityName);
        }
        if (params[prop] && params[prop].entityLabel) {
            result = insertVariable(result, prop + ':entityLabel', params[prop].entityLabel);
        }
    }

    return result;
};

const loadLogo = function(ctx){
    const {$scope, settings, $container} = ctx;
    const { clientLogo } = settings;
    if(!clientLogo) return;

    const clientLogoSectionCoords = {
        start:{
            x: 1014,
            y: 4
        },
        end:{
            x: 1472,
            y: 4
        }
    };

    const maxImgWidth = clientLogoSectionCoords.end.x - clientLogoSectionCoords.start.x;
    const maxImgHeight = 91;


    // Get image width and height
    const image = $("<img />",{
        src: clientLogo
    })[0];

    $scope.clientLogoSrc = clientLogo;
    image.onload = function(){
        // console.log("image loaded");
        let imgWidth = image.width;
        let imgHeight = image.height;
        // console.log("image dimensions=", imgWidth, "x", imgHeight);
        if(imgHeight > maxImgHeight) imgHeight = maxImgHeight;
        if(imgWidth > maxImgWidth) imgWidth = maxImgWidth;

        // $scope.clientLogoWidth = imgWidth;
        // $scope.clientLogoHeight = imgHeight;
        // $scope.clientLogoX = clientLogoSectionCoords.end.x - imgWidth;
        // $scope.clientLogoY = maxImgHeight - imgHeight;

        $("#client-logo-img").attr("x", clientLogoSectionCoords.end.x - imgWidth);
        $("#client-logo-img").attr("y", maxImgHeight - imgHeight);
        $("#client-logo-img").attr("width", imgWidth);
        $("#client-logo-img").attr("height", imgHeight);
    };
};

const handleToolbar = function(ctx){
    // Hide toolbar trigger button
    const toolbarTrigger = $(".mat-fab-toolbar-content mat-fab-trigger");

    if(toolbarTrigger.length > 0){
        toolbarTrigger.hide();

        const toolbarActionPanels = $("mat-toolbar mat-fab-actions .tb-dashboard-action-panel");
        const toolbarButtons = $(toolbarActionPanels[1]).children("button");
        const fullscreenBtn = toolbarButtons.filter(function(_, element){
            return $(element).text() === "fullscreen";
        }).first();

        fullscreenBtn.click();
    // console.log("element", toolbarTrigger, "btns", toolbarButtons, "fullscreen", fullscreenBtn);
    }
};

self.onInit = function() {
    const ctx = self.ctx;
    console.log(ctx);
    const {$scope, stateController, settings} = ctx;

    const dashboardTitle = buildDashboardTitle(stateController);

    $scope.title = dashboardTitle ? dashboardTitle : "Dashboard Title";
    $scope.stateIndex = stateController.getStateIndex();
    $scope.widgetBgColor = ctx.widget.config.backgroundColor;

    const headerSvg = $("#nav-header__svg");
    const svgGroup = headerSvg.children("g").first();
    const navBtns = svgGroup.children(".nav-btn");
    const navBtnsIcons = svgGroup.children(".nav-btn__icon");

    const headerHeight = ctx.height;
    const headerWidth = ctx.width;

    headerSvg.attr("viewBox", `0 0 ${headerWidth} ${headerHeight}`);

    loadLogo(ctx);
    handleToolbar(ctx);
    // Scale svg based on widget width
    headerSvg.children("g").first().attr("transform", `scale(${headerWidth/1920},${headerHeight/100})`);

    const isHomeState = $scope.stateIndex === 0;
    // Change nav buttons style based on dashboard state
    if(isHomeState){
        navBtns.attr("fill", "#9DE0A93F");

        navBtns.css("cursor", "auto");
        navBtnsIcons.css("cursor", "auto");
    }else{
        navBtns.attr("fill", "#9DE0A9");

        navBtns.css("cursor", "pointer");
        navBtnsIcons.css("cursor", "pointer");
    }

    // Dashboard states navigation
    $scope.goTo = function(dest){
        switch (dest) {
            case "BACK":
                stateController.navigatePrevState(isHomeState? 0 : $scope.stateIndex - 1);
                break;
            case "HOME":
                stateController.navigatePrevState(0);
                break;
        }
    };
};

self.onResize = function() {
    const {height, width} = self.ctx;
    const headerSvg = $("#nav-header__svg");
    // console.log("width scale=", width/1920);

    headerSvg.children("g").first().attr("transform", `scale(${width/1920}, ${height/100})`);
    headerSvg.attr("viewBox", `0 0 ${width} ${height}`);
    // headerSvg.attr("width", width);
};

